import React, { useState } from 'react';
import {
  Form,
  Input,
  Button,
  Select,
  Space,
} from 'antd';

const AddMentor = () => {

  return (
    <>
      <Space><h1>Add Mentor</h1></Space>
      <Form
        labelCol={{
          span: 8,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: 'small',
        }}
      >
        <Form.Item label="Mentor Name">
          <Input />
        </Form.Item>
        <Form.Item label="Select Companies">
          <Select>
            <Select.Option value="demo">Demo</Select.Option>
          </Select>
        </Form.Item>
        <Form.Item label="Button">
          <Button>Button</Button>
        </Form.Item>
      </Form>
    </>
  );
};

export default AddMentor;
